#include <ctime>
#include <iostream>
#include <string>
#include <vector>

using namespace std;

class Solution {
public:
    void solve(vector<vector<char>>& a) {
        if (a.empty()) return;
        int n = a.size(), m = a[0].size();
        if (n < 3 || m < 3) return;
        vector<bool> v(n*m);
        for (int i = 1; i < n-1; ++i) {
            auto &row = a[i];
            for (int j = 1, k = i*m; j < m-1; ++j, ++k) {
                if (row[j] == 'X' || v[k]) continue;
                vector<int> q;
                if (visit(n, m, i, j, a, v, q))
                    update(m, a, q);
            }
        }
    }

    bool visit(int n, int m, int i, int j,
            vector<vector<char>> &a, vector<bool> &v, vector<int> &q) {
        if (a[i][j] == 'X' || v[i*m + j]) return true;
        if (i < 1 || i >= n-1 || j < 1 || j >= m-1) return false;
        v[i*m + j] = true;
        if (visit(n,m,i,j+1,a,v,q) && visit(n,m,i+1,j,a,v,q)
            && visit(n,m,i,j-1,a,v,q) && visit(n,m,i-1,j,a,v,q)) {
            q.push_back(i*m + j);
            return true;
        }
        return false;
    }

    void update(int m, vector<vector<char>> &a, vector<int> &q) {
        while (!q.empty()) {
            int i = q.back() / m, j = q.back() % m;
            q.pop_back();
            a[i][j] = 'X';
        }
    }
};

